import Head from 'next/head';
import Navbar from './Navbar';

const Layout = (props) => (
  <div>
    <Head>
      <title>BitzPrice</title>
    </Head>
    <Navbar/>
    <div className="container">
      {props.children}
    </div>
  <style jsx>
    {`
    .container {
          margin: 50px;
         
        }
    .body{
      background-color: red;
    }
    `}
  </style>
  </div>
);

export default Layout;
